    "button": {
        backgroundColor: '#202d74',
        color: '#ffffff',
        height:50,
        fontSize:12,
        width:'100%',
        marginTop:5,
        marginBottom:5
    }
})
const TransitionButton = (props) => {
    const classes = useStyles();
    return (
             <Button className={classes.button} variant="contained" onClick={() => props.onClick()}>
                {props.label}
            </Button>



    )
}

export default TransitionButton
